	<text transform="matrix(1 0 0 1 144.9772 43.0393)" class="st0 st1 st2">Art across cultures</text>

<g id="Layer_9">

	<text transform="matrix(1 0 0 1 144.9772 93.0745)"><tspan x="0" y="0" class="st0 st4 st5">View works of art across cultures such as comparing works by artists from different nationalities or </tspan><tspan x="0" y="28.32" class="st0 st4 st5">looking at a medium or classification of art (e.g., design) from various geographic regions.</tspan></text>
</g>
<g id="Layer_8">

	<text transform="matrix(1.0029 0 0 1 145.6286 594.7102)"><tspan x="0" y="0" class="st6 st7 st8">Sculptures by countries. </tspan><tspan x="344.14" y="0" class="st6 st4 st9">This example includes 10 artists (Beuys, Duchamp, Ernst, </tspan><tspan x="0" y="31.86" class="st6 st4 st9">Kusama, Matisse, Miro, Paik, Picasso, Rauschenberg, Walker) and shows the percentages </tspan><tspan x="0" y="67.26" class="st6 st4 st9">of sculptures in MoMA’s collection that are represented by these artists’ nationalities.</tspan><tspan x="1006.28" y="67.26" class="st6 st4 st8"> </tspan><tspan x="0" y="123.9" class="st10 st4 st5">To explore more on how to view art across cultures using a subset of 32 artists in MoMA’s collection, </tspan><tspan x="0" y="152.22" class="st10 st4 st5">go to </tspan><tspan x="63.36" y="152.22" class="st11 st4 st5"><a x="63.36" y="152.22" class="st11 st4 st5" href="https://tinyurl.com/x4fyu7za" target="_blank">https://tinyurl.com/x4fyu7za</a></tspan><tspan x="357.44" y="152.22" class="st10 st4 st5">.</tspan></text>

<script type="text/javascript">

let tooltip=document.querySelector('.tooltip')

// gets position of mouse on the page
function getpos(event) {
	var e = window.event;
	x = e.clientX ;
	y = e.clientY ;
} 

function updateTooltip(text_to_display){
	tooltip.innerHTML=text_to_display
	getpos()
	tooltip.style.opacity=1
	tooltip.style.left=x+30+"px"
	tooltip.style.top=y-30+"px"
}

function clearTooltip() {
	tooltip.style.opacity=0
}

</script>
